      "description": "<p>Una pantalla que brilla sobre todo lo conocido</p><p>La pantalla OLED Super Retina XDR de 6,5\", sin marcos y con una resolución FullHD+, es la pantalla más nítida diseñada por Apple. Cuenta con dos niveles máximos de brillo que se ajustan automáticamente a la luz del ambiente. Gracias a la alta intensidad de contrastes y a un mayor nivel de detalle, es perfecta para ver películas HDR, incluso bajo el sol.</p><br><p>Fotografías más reales</p><p>El iPhone 11 Pro Max tiene un revolucionario sistema de tres cámaras que multiplica tu capacidad creativa y es fácil de usar. Con su cámara ultra angular nadie se queda afuera de la toma ya que abarca un campo visual cuatro veces más amplio. El modo Noche permite capturar los mejores momentos aun con poca luz, como una fiesta con amigos, y de forma automática. Pero esto no es todo, su cámara trasera teleobjetivo toma retratos con calidad profesional y al hacer zoom registra con detalle animales en entornos naturales o personas en eventos deportivos.</p><br><p>Grabá y editá videos a un nivel profesional</p><p>Todas las cámaras del iPhone 11 Pro Max graban videos en 4K con una nitidez increíble. Su cámara ultra gran angular permite capturar paisajes imperdibles y escenas en movimiento, como a un amigo andando en bicicleta en el parque. ¿Un recital de música? Hacé zoom en la imagen y el sonido también se acercará.</p><br><p>Un iPhone que te ofrece todo</p><p>El nuevo chip U1 diseñado por Apple usa tecnología de banda ultraancha que permite al iPhone 11 Pro Max ubicar con precisión otros dispositivos Apple que tengan el mismo chip. Además, el sistema de autentificación Face ID reconoce tu rostro para brindarte mayor seguridad que la tecnología Touch ID. Como si esto fuera poco, con su chip A13 Bionic y la batería de carga rápida, navegá a máxima velocidad y sin interrupciones.</p><br>",
